import React from 'react';
import '../../styles/css/PlayersSelection.css';

const CheatChars = [
  {
    id: 'php',
    name: 'Super PHP',
    avatar: 'https://media2.giphy.com/media/3NBHdctVN0KS4/source.gif',
    miniPic: 'https://justdigital.agency/wp-content/uploads/2017/03/php-hero.png',
    strength: 10,
    intel: 5
  },

  {
    id: 'angular',
    name: 'En Gros Lard',
    avatar: 'https://redcdn.net/hpimg4/pics/747740GrosBidePeinture.gif',
    miniPic: 'https://i.skyrock.net/6976/101476976/pics/3301549098_1_3_XpzJuYaC.jpg',
    strength: 35,
    intel: 20
  },

  {
    id: 'react',
    name: 'El REACTor',
    avatar: 'https://media3.giphy.com/media/Gt0VZVdElWbzq/source.gif',
    miniPic: 'https://revelry.co/wp-content/uploads/2019/05/react-native-UX-design.gif',
    strength: 90,
    intel: 100
  },

  {
    id: 'pierre',
    name: 'Cow Man',
    avatar: 'http://www.gifsanimes.fr/glitter-gifs/c/cow-boy/cow-boy-gifs-animes-6419382.gif',
    miniPic: 'https://www.askideas.com/media/13/Cow-In-Man-Dress-And-Turban.jpg',
    strength: 90,
    intel: 80
  }
];

const CheatPlayer = () =>
  CheatChars.map(wesh => (
    <img
      className="miniPic"
      src={wesh.miniPic}
      alt={wesh.name}
      onMouseOver={() => console.log(wesh.name)}
    />
  ));

export default CheatPlayer;
